      <li>ค่ากิน<span> -500</span></li>
      <li>ค่าที่พัก<span> -500</span></li>
    </ul>
  );
}

function App() {
  return (
    <div>
      <Title/>
      <Description/>
      <Transaction/>
    </div>

  );
}

export default App;
